import React from "react"
import "./home.css"
import {useHistory} from 'react-router-dom';


const Home = () => {

  function setup(e) {
    alert('You clicked setup.');
  }
  const history = useHistory();

  const routeChange = () =>{ 
    let path = '/MeetReq'; 
    history.push(path);
  }
  const navigate = useNavigate();
  const requestMeeting = useCallback(() => navigate('/MeetReq', {replace: true}), [navigate]);

  return (

    <>
      <section className='hero'>
        <div>

          <h2>Welcome Arya to TOPY Station</h2>
        <div class="mainDiv">
          <button class="b1" onClick={setup}>Setup Meeting</button>
          <button class="b2" onClick={routeChange}>Incoming Request</button>
          <div>
          <img src={require('./old.jpg')}></img>
          </div>
        </div>
        </div>


      </section>
    </>
  )
}
export default Home
